        require((_tokenId + _tokenCount) <= (maxSupply - reservedTokens), "Purchase will exceed the token supply!");
        _batchMintTokens(_tokenCount);
    }

    function _batchMintTokens(uint _tokenCount) private {
        uint256 i = 0;
        for (i = 0; i < _tokenCount; i++) {
            _mintGalaxiator();
